Trait* cFastXmlElement::select()
{
   return clsTraits();
}

Trait* cFastXmlElement::clsTraits()
{
      static Trait TRAITS[] = {
         {      0,      Trait::TYPE_BEGIN,      "cFastXmlElement",    0,                    0,              0,      cFastXmlNode::clsTraits()  },
         {      0,      Trait::TYPE_FUN,        "cFastXmlElement",    "selectSingleNode",   clsInvoke,      0,      0                  },
         {      1,      Trait::TYPE_FUN,        "cFastXmlElement",    "selectNodes",        clsInvoke,      1,      0                  },
         {      2,      Trait::TYPE_GET,        "cFastXmlElement",    "tagName",            clsInvoke,      2,      0                  },
         {      3,      Trait::TYPE_FUN,        "cFastXmlElement",    "getAttribute",       clsInvoke,      3,      0                  },
         {      4,      Trait::TYPE_FUN,        "cFastXmlElement",    "setAttribute",       clsInvoke,      4,      0                  },
         {      5,      Trait::TYPE_FUN,        "cFastXmlElement",    "removeAttribute",    clsInvoke,      5,      0                  },
         {      6,      Trait::TYPE_FUN,        "cFastXmlElement",    "getAttributeNode",   clsInvoke,      6,      0                  },
         {      7,      Trait::TYPE_FUN,        "cFastXmlElement",    "setAttributeNode",   clsInvoke,      7,      0                  },
         {      8,      Trait::TYPE_FUN,        "cFastXmlElement",    "removeAttributeNode",clsInvoke,      8,      0                  },
         {      9,      Trait::TYPE_FUN,        "cFastXmlElement",    "getElementsByTagName",clsInvoke,      9,      0                  },
         {      10,     Trait::TYPE_FUN,        "cFastXmlElement",    "normalize",          clsInvoke,      10,     0                  },
         {      0,      Trait::TYPE_END,        "cFastXmlElement",    0,                    0,              0,      0                  },
      };

      return TRAITS;
}

